import styled from "styled-components";

const Login = (props) => {
   return (
    <Container>
        <Content>
         <BgImage />
        </Content>
    </Container>
   );
};

const Container = styled.section`
  overflow: hidden;
  display: flex;
  flex-direction: column;
  text-align: center;
  height: 100vh;
`;

const Content = styled.div`
  margin-bottom: 10vw;
  width: 100%;
  position: relative;
  min-height: 100vh;
  box-sizing: border-box;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  padding: 80px 40px;
  height: 100%;
`;

const BgImage = style.div`
    background-image: url("/images/Login0background.jpg");
`;

export default Login;
